import './jogos.css'
import { Celula } from '../../models/bingo/celula';

function Jogos() {



  return (
    <div className="jogos">
      <div id='bingo'>
        <Celula text={"cu"} />
      </div>
      <div className='lista'>
        <button>4x4</button>
        <button>5x5</button>
        <h1>Jogos de Medo</h1>
        <input id="input1" value={"cu"}></input>
      </div>
    </div>
  );
}

export default Jogos;
